DROP TABLE IF EXISTS `PATIENT`;
CREATE TABLE `PATIENT` (
  `id` int(11) NOT NULL,
  `firstName` varchar(30) NOT NULL,
  `lastName` varchar(30) NOT NULL,
  `gender` varchar(2) NOT NULL,
  `birthDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `age` int(11) NOT NULL,
  `highBpHistory` tinyint(1) NOT NULL,
  `smokingHistory` tinyint(1) NOT NULL,
  `currentSmoker` tinyint(1) NOT NULL,
  `medication` varchar(50),
  `diagnosticCode` varchar(10),
  `lastPrimaryCareVisit` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
);

